import { axiosInstance, axiosAuthInstance } from "./axios"

export async function signIn_API(payload) {
   try {
      const response = await axiosInstance.post(
         `/account/login/NO_TOKEN`, payload
      )

      return [null, response.data]
   } catch (error) {
      return [error, null]
   }
}

export async function register_API(payload) {
   try {
      const response = await axiosInstance.post(
         `/account/registration/NO_TOKEN`, payload
      )

      return [null, response.data]
   } catch (error) {
      return [error, null]
   }
}
